import { useState, useEffect } from 'react';
/** @jsx jsx */
import { jsx, css } from '@emotion/core';
import { motion } from 'framer-motion';
import jwtDecode from 'jwt-decode';

import useThemeModel from '../../models/useThemeModel';
import useAuthModel from '../../models/useAuthModel';
import { checkUserInfo } from '../../utils/requests';

const User = ({ onClick }) => {
	const { theme } = useThemeModel();
	const { auth } = useAuthModel();
	const [avatar, setAvatar] = useState(
		// 'http://pic.616pic.com/ys_img/00/27/13/RnzmVtJi6T.jpg'
		'data:image/png;base64,'
	);

	// 
	useEffect(() => {
		if (auth) {
			const { userid } = jwtDecode(localStorage.token);
			const userId = { id: userid };
			checkUserInfo(userId).then((response) => {
				setAvatar(response.data[0].avatar);
			});
		}
	}, [auth]);

	return (
		<motion.div
			onClick={onClick}
			css={css`
				border-radius: 50%;
				cursor: pointer;
				display: flex;
				justify-content: center;
				align-items: center;
				box-shadow: 0 0 30px ${theme.color.shadow};
				margin-left: 20px;
				overflow: hidden;
				-webkit-app-region: no-drag;
				img {
					width: 40px;
					height: 40px;
				}
			`}
			whileHover={{ scale: 1.1 }}
			whileTap={{ scale: 0.9 }}
		>
			<img src={avatar} alt='avatar' />
		</motion.div>
	);
};

export default User;
